import styled from 'styled-components';


const ChatStyled = styled.div `
  {

        background-color: red;
       
        overflow-y: scroll;
        overflow:hidden;
 
    }

    .header{
        display:flex;
        width: 100%;
        justify-content: space-between;
        padding: 20px;
        border-bottom: 1px solid lightgray
    }
`

export default ChatStyled;
